script: |
  super -f text -I q10312.spq | sort > q10312.out

inputs:
  - name: q10312.spq
    data: |
      SELECT ALL + col1 * 40 AS col0 FROM tab2 (FORMAT parquet) WHERE + + CAST ( 14 AS INTEGER ) NOT BETWEEN - col1 * col1 AND ( - col0 ) * - 38;
  - name: tab2

outputs:
  - name: q10312.out
    data: |
